import React from 'react';
import {
  AppBar,
  Container,
  Toolbar, 
  Menu,
  MenuItem, 
  Typography
} from '@mui/material';

const pages = ['About', 'Work', 'Contact'];

const NavBar = () => {
  return (
    <AppBar 
      position="static"
      sx={{
        height: '7rem',
        background : 'radial-gradient(circle, rgba(121,171,189,1) 0%, rgba(42,33,110,1) 100%)'
      }}
    >
      <Container >
        <Toolbar>
          <Menu>
            {pages.map((page) => (
                <MenuItem key={page}>
                  <Typography 
                    textAlign="center"
                    sx={{
                      color: 'black'
                    }}
                  >{page}</Typography>
                </MenuItem>
              ))}
          </Menu>
        </Toolbar>
      </Container>
    </AppBar>
  );
};
export default NavBar;
